import React from 'react';
import {Switch, Route} from 'react-router-dom';
import {NotFound, Dashboard} from './pages/index';

function App() {
  return (
    <div >
      <Switch>
        <Route path='/dashboard' component={Dashboard} />
        <Route component={NotFound}/>
      </Switch>
    </div>
  );
}
